import React from 'react';


export default function Pokemon (props){

    return(
        <div>
            <h4>    
                {this.props.id}
            </h4>
            <h3>
                {this.props.name}
            </h3>
            <img src={this.props.image} alt={this.props.name}></img>
            <h5>
                {this.props.type[0]}
            </h5>
            <h5>
                {this.props.type[1]}
            </h5>
        </div>
    )
}
